se strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1667648","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"MlUwKqlLQEClTkATYQtAQI/C9ShcD0BAPujZrPokQEB5WKg1zStAQJJc/kP6RUBAvp8aL908QECF61G4HoVAQFD8GHPXgkBArK3YX3Z3QEB7FK5H4XpAQM6I0t7gm0BAGy/dJAaZQEDrc7UV+4NAQG3n+6nx6kBAMlUwKqnLQEAMk6mCUdlAQMSxLm6jkUBAKVyPwvWoQEAgQfFjzG1AQAHeAgmKZ0BAb4EExY+hQEAzMzMzM7NAQD0K16NwvUBAbqMBvAW6QEBt5/up8epAQGWqYFRSF0FANs07TtHpQEC7uI0G8O5AQLAD54wo/UBAwFsgQfELQUC2hHzQswFBQP5D+u3rMEFAzojS3uAbQUBFR3L5DxFBQOC+DpwzEkFAP8bctYQMQUAJG55eKbtAQBkEVg4tGkFASnuDL0z+QECgGi/dJB5BQNiBc0aUPkFAb4EExY8hQUB90LNZ9UlBQGIQWDm0YEFA5dAi2/lmQUAIPZtVn1NBQOqVsgxxHEFAUPwYc9cCQUDtDb4wmbpAQPOOU3Qkv0BAtoR80LOBQECgGi/dJJ5AQEp7gy9MfkBAUrgehetRQEB88rBQa2JAQCv2l92TX0BA845TdCQ/QEBVMCqpE/A/QDtwzojSBkBAZapgVFIXQEDBOSNKe/M/QIts5/upCUBAlkOLbOcTQECamZmZmRlAQFyPwvUoXEBAAd4CCYpnQECh1jTvOG1AQAK8BRIUT0BAZ0Rpb/BNQECLbOf7qYlAQGZmZmZmZkBAkxgEVg6
